import AxiosClient from './AxiosClient'


const getToken = async (): Promise<string> => {
    try {
        const response = await AxiosClient.post('/auth', { apiKey: "23567b218376f79d9415" })
        return response.data.token
    } catch (error) {
        throw Error(error)
    }
    return ''
}

export default getToken
